Has_score_Card__1.query:
q = load "${App.Datasets.Demo_Supplier_Dashboard_tp.FullyQualifiedName}";
q = group q by 'HasScoreCard';
q = foreach q generate 'HasScoreCard', case 'HasScoreCard'  when "Yes" then "With score card" else "Without score card" end as'scorecard' , unique('Supplier') as 'unique_Supplier';
q = order q by 'scorecard' asc;
q = limit q 2000;

Supplier_Data_1.query:
q = load "${App.Datasets.Demo_Supplier_Dashboard_tp.FullyQualifiedName}";
result = group q by ('Supplier', 'Rank', 'SBTI_Target_Status', 'Emission_Calculation_Method', 'HasScoreCard');
result = foreach result generate q.'Supplier' as 'Supplier', q.'Rank' as 'Rank', q.'SBTI_Target_Status' as 'SBTI_Target_Status', q.'Emission_Calculation_Method' as 'Emission_Calculation_Method', q.'HasScoreCard' as 'HasScoreCard', avg(q.'Contribution_total_Emissions_Card') as 'Contribution to Total Emissions', avg(q.'Expense_Ratio') as 'Expense Ratio', avg(q.'Procurement_Emissions') as 'Emissions', avg(q.'RankNro') as 'RankNro';
result = order result by 'RankNro' {{cell(static_Rank_Order_1.selection, 0, "Value").asString()}};
result = filter result by 'RankNro' <= {{cell(static_Limit_ScoreCa_1.selection, 0, "Value").asObject()}};
